import TripItem from "./TripItem";
import axios from "axios";
import { useState } from "react";

function TripsList() {
  const [trips, setTrips] = useState(null);

  axios.get("/api/v1/trips").then((res) => {
    const trips = res.data;
    setTrips(trips);
    console.log(trips);
  });
  return (
    <h1>
      <TripItem />
    </h1>
  );
}

export default TripsList;
